/*Table structure for table `zq_customer` */

DROP TABLE IF EXISTS `zq_customer`;

CREATE TABLE `zq_customer` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '客户类型',
  `exhibition_id` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '展会id',
  `name` varbinary(32) NOT NULL COMMENT '姓名',
  `sex` tinyint(1) NOT NULL DEFAULT '1' COMMENT '称谓',
  `mobile` varchar(32) NOT NULL COMMENT '手机',
  `email` varchar(64) NOT NULL COMMENT '邮箱',
  `company_name` varchar(255) NOT NULL COMMENT '单位名称',
  `position` varchar(255) NOT NULL COMMENT '职务',
  `company_type_id` tinyint(1) unsigned DEFAULT '1' COMMENT '公司类型',
  `department` varchar(255) DEFAULT NULL COMMENT '部门',
  `phone` varchar(32) DEFAULT NULL COMMENT '电话',
  `fax` varchar(32) DEFAULT NULL COMMENT '传真',
  `url` varchar(255) DEFAULT NULL COMMENT '网址',
  `country` int(11) DEFAULT '1',
  `province` varchar(64) DEFAULT NULL COMMENT '省id',
  `city` varchar(64) DEFAULT NULL COMMENT '市id',
  `district` varchar(64) DEFAULT NULL COMMENT '区id',
  `remark` text COMMENT '备注',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `created_at` int(11) NOT NULL COMMENT '创建时间',
  `updated_at` int(11) NOT NULL COMMENT '更新时间',
  `status` tinyint(1) DEFAULT '0' COMMENT '0:待审1、通过、9、驳回',
  `rejected_reason` text COMMENT '拒绝原因',
  PRIMARY KEY (`id`),
  KEY `name` (`name`),
  KEY `exhibition_id` (`exhibition_id`),
  KEY `mobile` (`mobile`),
  KEY `company_type_id` (`company_type_id`),
  KEY `province` (`province`),
  KEY `city` (`city`),
  KEY `countrys` (`district`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;

