/*Table structure for table `zq_discountinfo` */

DROP TABLE IF EXISTS `zq_discountinfo`;

CREATE TABLE `zq_discountinfo` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(11) NOT NULL COMMENT '展会id',
  `car_brand_id` int(11) DEFAULT NULL COMMENT '汽车品牌id,主办方发布产品没有汽车品牌',
  `discount_title` varchar(60) COLLATE utf8_unicode_ci NOT NULL COMMENT '标题',
  `discount_thumb` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '优惠活动图片',
  `discount_content` text COLLATE utf8_unicode_ci NOT NULL COMMENT '优惠活动内容',
  `company_name` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT '单位名称',
  `check_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审核状态0待审核，1通过，2驳回',
  `reject_reason` text COLLATE utf8_unicode_ci COMMENT '驳回理由',
  `joiner_id` int(11) DEFAULT NULL COMMENT '参展商id',
  `organizer_id` int(11) DEFAULT NULL COMMENT '主办方id',
  `member_id` int(11) NOT NULL COMMENT '创建者id/用户id',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `discount_or_product` tinyint(1) NOT NULL COMMENT '优惠信息或产品发布，1为优惠信息，2为产品发布',
  `is_need_check` tinyint(1) NOT NULL COMMENT '是否需要审核 1是，0否，主办方发布产品不需审核',
  `show_order` int(3) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `exhibition_id` (`exhibition_id`) USING BTREE,
  KEY `car_brand_id` (`car_brand_id`) USING BTREE,
  KEY `joiner_id` (`joiner_id`) USING BTREE,
  KEY `member_id` (`member_id`) USING BTREE,
  KEY `show_order` (`show_order`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

