/*Table structure for table `zq_exhibition` */

DROP TABLE IF EXISTS `zq_exhibition`;

CREATE TABLE `zq_exhibition` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `organizer_id` int(11) unsigned NOT NULL COMMENT '举办方id',
  `title` varchar(256) NOT NULL DEFAULT '',
  `industry_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '展会行业',
  `area_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '展会所属地区',
  `provinces` int(11) DEFAULT '0' COMMENT '省',
  `citys` int(11) DEFAULT '0' COMMENT '市',
  `countrys` int(11) DEFAULT '0' COMMENT '区',
  `addr` varchar(64) NOT NULL DEFAULT '' COMMENT '展会地址',
  `detail` text NOT NULL COMMENT '展会详情介绍',
  `ticket_background_url` varchar(256) NOT NULL DEFAULT '' COMMENT '票面背景图片',
  `ticket_ad_img` varchar(255) NOT NULL DEFAULT '' COMMENT '广告图片',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态码, 0:待审核, 1:同意,2:禁用,9:不同意',
  `alipay_id` int(11) DEFAULT '0' COMMENT '支付宝信息关联id',
  `wechat_id` int(11) DEFAULT '0' COMMENT '公众号信息管理id',
  `start_time` date DEFAULT NULL,
  `end_time` date DEFAULT NULL,
  `buy_module` char(50) DEFAULT NULL COMMENT '购买模块',
  `pic` varchar(128) DEFAULT NULL COMMENT '展会主图',
  `opening_time` varchar(50) DEFAULT NULL COMMENT '展会每日开放时间',
  `logo` varchar(128) DEFAULT '' COMMENT '展会logo',
  `ticket_flag` int(11) unsigned DEFAULT '0',
  `daily_open_time` char(10) DEFAULT NULL COMMENT '每日开展时间',
  `daily_close_time` char(10) DEFAULT NULL COMMENT '每日闭展时间',
  `service_tel` varchar(100) DEFAULT NULL COMMENT '服务电话',
  `limit_total_tickets` int(6) DEFAULT '0' COMMENT '购票总量限制',
  `limit_day_tickets` int(6) DEFAULT '0' COMMENT '每日购票总量限制',
  `buy_start_time` int(11) DEFAULT '0' COMMENT '每日购票开始时间',
  `buy_end_time` int(11) DEFAULT '0' COMMENT '每日购票结束时间',
  `free_buy_start_time` int(11) DEFAULT '0' COMMENT '免费每日购票开始时间',
  `free_buy_end_time` int(11) DEFAULT '0' COMMENT '免费每日购票结束时间',
  `limit_total_tickets_free` int(6) DEFAULT '0' COMMENT '免费票总量限制张数',
  `limit_day_tickets_free` int(6) DEFAULT '0' COMMENT '免费票每日购票总量限制张数',
  `is_check_identify` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否验证身份证： 0：不验证   1：需要验证',
  `limit_ad_pc_buy_ticket` tinyint(1) NOT NULL DEFAULT '5' COMMENT 'PC购票广告图限制',
  `limit_ad_m_buy_ticket` tinyint(1) NOT NULL DEFAULT '5' COMMENT 'M端购票广告图限制',
  `limit_ad_ticket` tinyint(1) NOT NULL DEFAULT '5' COMMENT '电子票广告图限制',
  PRIMARY KEY (`id`),
  KEY `industry_id` (`industry_id`) USING BTREE,
  KEY `area_id` (`area_id`) USING BTREE,
  KEY `idx_organizer_id` (`organizer_id`) USING BTREE,
  CONSTRAINT `zq_exhibition_ibfk_1` FOREIGN KEY (`industry_id`) REFERENCES `zq_industry` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `zq_exhibition_ibfk_2` FOREIGN KEY (`area_id`) REFERENCES `zq_area` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

