CREATE TABLE `zq_exhibition_discount` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '展会ID',
  `cat` tinyint(3) NOT NULL DEFAULT '0' COMMENT '优惠活动种类，0:免费, 1:一元',
  `title` varchar(256) NOT NULL DEFAULT '' COMMENT '活动名称',
  `start_time` datetime NOT NULL COMMENT '优惠活动开始时间',
  `end_time` datetime NOT NULL COMMENT '优惠活动结束时间',
  `discount_price` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠后的价格，以分为单位',
