  PRIMARY KEY (`id`),
  KEY `idx_exhibition_id` (`exhibition_id`) USING BTREE,
  CONSTRAINT `zq_exhibition_discount_ibfk_1` FOREIGN KEY (`exhibition_id`) REFERENCES `zq_exhibition` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

