/*Table structure for table `zq_form_info` */

DROP TABLE IF EXISTS `zq_form_info`;

CREATE TABLE `zq_form_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '序号',
  `page_id` int(11) NOT NULL COMMENT '对应的购票页面的id',
  `exhibition_id` int(11) NOT NULL COMMENT '展会id',
  `uuid` varchar(36) NOT NULL COMMENT '对应form_data表中的uuid',
  `create_time` datetime NOT NULL COMMENT '记录添加时间',
  `zffs` varchar(8) DEFAULT NULL COMMENT '支付方式，ali-阿里，wx-微信',
  `wechat_id` int(11) DEFAULT NULL COMMENT '微信支付id',
