  `amount` decimal(10,2) DEFAULT '0.00' COMMENT '总票价',
  `share_user_id` int(11) DEFAULT '0' COMMENT '分享用户id',
  PRIMARY KEY (`id`),
  KEY `uuid` (`uuid`) USING BTREE,
  KEY `page_id` (`page_id`) USING BTREE,
  KEY `exhibition_id` (`exhibition_id`) USING BTREE,
  KEY `seoid` (`seoid`) USING BTREE
