/*Table structure for table `zq_group` */

DROP TABLE IF EXISTS `zq_group`;

CREATE TABLE `zq_group` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(256) NOT NULL DEFAULT '' COMMENT '名称',
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '显示顺序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_group` */

/*Table structure for table `zq_inbox` */

DROP TABLE IF EXISTS `zq_inbox`;

CREATE TABLE `zq_inbox` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `sender_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发送者ID',
  `recver_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '接收者ID',
  `msg` text COLLATE utf8_unicode_ci COMMENT '内容',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `zq_inbox_ibfk_1` (`sender_id`) USING BTREE,
  KEY `zq_inbox_ibfk_2` (`recver_id`) USING BTREE,
  CONSTRAINT `zq_inbox_ibfk_1` FOREIGN KEY (`sender_id`) REFERENCES `zq_member` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `zq_inbox_ibfk_2` FOREIGN KEY (`recver_id`) REFERENCES `zq_member` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_inbox` */

/*Table structure for table `zq_industry` */

DROP TABLE IF EXISTS `zq_industry`;

CREATE TABLE `zq_industry` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(256) NOT NULL DEFAULT '' COMMENT '名称',
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '显示顺序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

