  `lottery_project_id` int(11) unsigned NOT NULL,
  `name` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '说明一等奖',
  `prize` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '奖品名称',
  `prize_num` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '奖品数量',
  `level` tinyint(1) DEFAULT NULL COMMENT '奖品级别排序',
  `probability` decimal(4,2) DEFAULT NULL COMMENT '抽奖机率',
  `lottery_time` datetime DEFAULT NULL COMMENT '抽奖时间',
  `info` char(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '说明',
  `created_at` datetime DEFAULT NULL COMMENT '奖品创建时间',
  `engaged` int(11) NOT NULL DEFAULT '0' COMMENT '已经抽走的数量',
  `updated_at` datetime DEFAULT NULL COMMENT '抽奖时间',
  PRIMARY KEY (`id`),
  KEY `lottery_project_id` (`lottery_project_id`) USING BTREE,
  CONSTRAINT `zq_lottery_level_ibfk_1` FOREIGN KEY (`lottery_project_id`) REFERENCES `zq_lottery_project` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_lottery_level` */

/*Table structure for table `zq_lottery_project` */

DROP TABLE IF EXISTS `zq_lottery_project`;

CREATE TABLE `zq_lottery_project` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(11) unsigned NOT NULL,
  `start` datetime DEFAULT NULL COMMENT '抽奖开始时间',
  `end` datetime DEFAULT NULL COMMENT '抽奖结束时间',
  `lottery_num` tinyint(1) DEFAULT '3' COMMENT '抽奖次数',
  `content` longtext COLLATE utf8_unicode_ci COMMENT '活动说明',
  `ticket_type` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '抽奖人数范围选择',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `type` tinyint(1) DEFAULT '1' COMMENT '活动类型 1大转盘 2摇一摇 3抢红包',
  `link_url` char(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_by` int(11) unsigned DEFAULT NULL,
  `updated_by` int(11) unsigned DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '活动发布0,未发布、1，已发布',
  PRIMARY KEY (`id`),
  KEY `exhibition_id` (`exhibition_id`) USING BTREE,
  KEY `created_by` (`created_by`) USING BTREE,
  KEY `updated_by` (`updated_by`) USING BTREE,
  CONSTRAINT `zq_lottery_project_ibfk_1` FOREIGN KEY (`exhibition_id`) REFERENCES `zq_exhibition` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `zq_lottery_project_ibfk_2` FOREIGN KEY (`created_by`) REFERENCES `zq_member` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `zq_lottery_project_ibfk_3` FOREIGN KEY (`updated_by`) REFERENCES `zq_member` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_lottery_project` */

/*Table structure for table `zq_lottery_record` */

DROP TABLE IF EXISTS `zq_lottery_record`;

CREATE TABLE `zq_lottery_record` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `lottery_level_id` int(11) unsigned NOT NULL,
  `lottery_project_id` int(11) unsigned NOT NULL,
  `lottery_code` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '兑奖码随机生成',
  `username` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '中奖人',
  `mobile` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '中奖人手机号码',
  `status` tinyint(1) DEFAULT '0' COMMENT '兑奖状态',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL COMMENT '兑奖时间',
  `updated_by` int(11) unsigned DEFAULT NULL COMMENT '操作人',
  PRIMARY KEY (`id`),
  KEY `lottery_code` (`lottery_code`,`mobile`) USING BTREE,
  KEY `lottery_project_id` (`lottery_project_id`) USING BTREE,
  KEY `lottery_level_id` (`lottery_level_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_lottery_record` */

/*Table structure for table `zq_main_channel` */

DROP TABLE IF EXISTS `zq_main_channel`;

CREATE TABLE `zq_main_channel` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) NOT NULL,
  `name` varchar(120) NOT NULL,
  `redirect_url` varchar(120) DEFAULT NULL,
  `sort_num` int(11) NOT NULL DEFAULT '0',
  `note` varchar(80) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_main_channel` */

/*Table structure for table `zq_main_news` */

DROP TABLE IF EXISTS `zq_main_news`;

CREATE TABLE `zq_main_news` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `channel_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `user_name` varchar(80) NOT NULL,
  `publish_time` datetime DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  `flag` varchar(128) DEFAULT NULL,
  `views` int(11) DEFAULT '0',
  `commonts` int(11) DEFAULT '0',
  `status` tinyint(1) DEFAULT '1',
  `title` varchar(128) NOT NULL,
  `title_format` varchar(128) DEFAULT NULL,
  `keywords` varchar(128) DEFAULT NULL,
  `summary` varchar(512) DEFAULT NULL,
  `content` text NOT NULL,
  `source` varchar(255) DEFAULT NULL,
  `author` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_main_news` */

/*Table structure for table `zq_matchinfo` */

DROP TABLE IF EXISTS `zq_matchinfo`;

CREATE TABLE `zq_matchinfo` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `exhibition_id` int(11) NOT NULL COMMENT '展会ID',
  `car_brand_id` int(11) NOT NULL COMMENT '汽车品牌',
  `stand_number` varchar(50) NOT NULL COMMENT '展位号',
  `sms_title` varchar(250) DEFAULT NULL COMMENT '短信前缀标题',
  `sms_content` text NOT NULL COMMENT '短信内容',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `modifi_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `audit_status` int(1) unsigned zerofill NOT NULL DEFAULT '0' COMMENT '审核状态 0 未审核 1 通过  2 驳回',
  `reason_text` text COMMENT '原因',
  `is_push` tinyint(1) DEFAULT '0' COMMENT '是否推送短信',
  `member_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `joiner_id` int(11) NOT NULL DEFAULT '0' COMMENT '展商ID',
  `createby_id` int(11) NOT NULL DEFAULT '0' COMMENT '创建者ID',
  `modifiby_id` int(11) NOT NULL DEFAULT '0' COMMENT '修改ID',
  PRIMARY KEY (`id`),
  KEY `exhibition_id` (`exhibition_id`) USING BTREE,
  KEY `joiner_id` (`joiner_id`) USING BTREE,
  KEY `car_brand_id` (`car_brand_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_matchinfo` */

/*Table structure for table `zq_member` */

DROP TABLE IF EXISTS `zq_member`;

CREATE TABLE `zq_member` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(32) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '用户名',
  `mobile` varchar(32) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `email` varchar(64) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '邮箱',
  `password` varchar(64) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '明文密码，测试完后删除此字段',
  `auth_key` varchar(64) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `access_token` varchar(64) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `enabled` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `flag` char(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份标识(付费用户/普通用户)',
  `alias` char(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '呢称',
  `avatar` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `pwd` char(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '明文',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `office` char(25) CHARACTER SET utf8 DEFAULT NULL COMMENT '职位',
  `openid` char(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '微信openid',
  `last_login_time` datetime DEFAULT NULL,
  `last_login_ip` char(32) COLLATE utf8_unicode_ci DEFAULT NULL,
  `uuid` char(36) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '通用唯一识别码',
  `user_identity` tinyint(1) DEFAULT '0' COMMENT '用户来源0sungoal,1,为baba',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`) USING BTREE,
  KEY `idx_mobile` (`mobile`) USING BTREE,
  KEY `uuid` (`uuid`) USING BTREE,
  KEY `user_identity` (`user_identity`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=27442 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

