/*Table structure for table `zq_member_data` */

DROP TABLE IF EXISTS `zq_member_data`;

CREATE TABLE `zq_member_data` (
  `member_id` int(11) NOT NULL AUTO_INCREMENT,
  `post_count` int(11) NOT NULL,
  `feed_count` int(11) NOT NULL,
  `following_count` int(11) NOT NULL,
  `follower_count` int(11) NOT NULL,
  `unread_notice_count` int(11) NOT NULL,
  `unread_message_count` int(11) NOT NULL,
  PRIMARY KEY (`member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_member_data` */

/*Table structure for table `zq_member_ext` */

DROP TABLE IF EXISTS `zq_member_ext`;

CREATE TABLE `zq_member_ext` (
  `member_id` int(10) unsigned NOT NULL,
  `detail_json` text COLLATE utf8_unicode_ci COMMENT '包含所有非公共属性',
  PRIMARY KEY (`member_id`),
  CONSTRAINT `zq_member_ext_ibfk_1` FOREIGN KEY (`member_id`) REFERENCES `zq_member` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_member_ext` */

/*Table structure for table `zq_member_follow` */

DROP TABLE IF EXISTS `zq_member_follow`;

CREATE TABLE `zq_member_follow` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL,
  `people_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `member_id` (`member_id`) USING BTREE,
  KEY `people_id` (`people_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_member_follow` */

/*Table structure for table `zq_member_gz` */

DROP TABLE IF EXISTS `zq_member_gz`;

CREATE TABLE `zq_member_gz` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL,
  `created_at` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `member_id` (`member_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

