/*Table structure for table `zq_member_message` */

DROP TABLE IF EXISTS `zq_member_message`;

CREATE TABLE `zq_member_message` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `sendfrom` int(11) NOT NULL COMMENT '发送者',
  `sendto` int(11) NOT NULL COMMENT '收件者',
  `subject` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '主题',
  `content` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '发送内容',
  `created_at` datetime NOT NULL COMMENT '发送时间',
  `read_indicator` tinyint(1) NOT NULL DEFAULT '0' COMMENT '读取标志（1为读取）',
  `inbox` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_member_message` */

/*Table structure for table `zq_messages` */

DROP TABLE IF EXISTS `zq_messages`;

CREATE TABLE `zq_messages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `from_member_id` int(11) NOT NULL DEFAULT '0' COMMENT '消息发送人',
  `to_member_id` int(11) NOT NULL DEFAULT '0' COMMENT '消息接收人',
  `msg` text COLLATE utf8_unicode_ci NOT NULL COMMENT '消息内容',
  `exhibition_id` int(11) NOT NULL DEFAULT '0' COMMENT '展会id',
  `msg_type` int(3) NOT NULL DEFAULT '0' COMMENT '消息类型',
  `is_read` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否阅读',
  `created_at` datetime NOT NULL,
  `update_at` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `to_member_id` (`to_member_id`) USING BTREE,
  KEY `exhibition_id` (`exhibition_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_messages` */

/*Table structure for table `zq_msg_logs` */

DROP TABLE IF EXISTS `zq_msg_logs`;

CREATE TABLE `zq_msg_logs` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '标题',
  `memberId` bigint(11) NOT NULL,
  `msg` text CHARACTER SET utf8 NOT NULL,
  `stem_from` tinyint(2) NOT NULL,
  `url` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '跳转url',
  `create_time` datetime NOT NULL,
  `is_read` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已读',
  PRIMARY KEY (`id`),
  KEY `memberId` (`memberId`) USING BTREE,
  KEY `is_read` (`is_read`) USING BTREE
