/*Table structure for table `zq_order` */

DROP TABLE IF EXISTS `zq_order`;

CREATE TABLE `zq_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(36) DEFAULT NULL COMMENT '订单号',
  `trade_no` varchar(256) DEFAULT NULL COMMENT '交易号',
  `payment` tinyint(1) DEFAULT NULL COMMENT '支付方式(0、mf/1、wx2、al)',
  `amount` int(11) DEFAULT NULL COMMENT '支付金额;以分为单位',
  `payment_status` int(11) DEFAULT NULL COMMENT '//支付状态：1已支付',
  `extra` text COMMENT '订单扩展信息、json结构',
  `status` int(11) DEFAULT NULL COMMENT '订单状态：0正常',
  `valid_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:正常1，已删除',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`) USING BTREE,
  KEY `amount` (`amount`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

