/*Table structure for table `zq_order_pay` */

DROP TABLE IF EXISTS `zq_order_pay`;

CREATE TABLE `zq_order_pay` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(11) unsigned NOT NULL COMMENT '展会ID',
  `ticket_id` int(11) unsigned NOT NULL COMMENT '票ID',
  `amount` int(11) DEFAULT NULL COMMENT '支付金额;以分为单位',
  `payment` tinyint(1) DEFAULT NULL COMMENT '支付方式(0、mf/1、wx2、al)',
  `payment_status` int(11) DEFAULT NULL COMMENT '//支付状态：1已支付',
  `extra` text COMMENT '订单扩展信息、json结构',
  `status` int(11) DEFAULT NULL COMMENT '订单状态：0正常',
  `trade_no` varchar(256) DEFAULT NULL COMMENT '交易号',
  `order_id` varchar(36) DEFAULT NULL COMMENT '订单号',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL COMMENT '更新时间',
  `member_id` int(11) DEFAULT NULL COMMENT '关联用户ID',
  `user_name` char(32) DEFAULT NULL COMMENT '买票人',
  `user_mobile` char(24) DEFAULT NULL COMMENT '手机号',
  `valid_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:正常1，删除',
  `openid` varchar(256) DEFAULT NULL COMMENT 'OpenId',
  PRIMARY KEY (`id`),
  KEY `exhibition_id` (`exhibition_id`) USING BTREE,
  KEY `ticket_id` (`ticket_id`) USING BTREE,
  KEY `openid` (`openid`(255)) USING BTREE,
  KEY `user_mobile` (`user_mobile`) USING BTREE,
  KEY `order_id` (`order_id`) USING BTREE,
  KEY `amount` (`amount`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

