/*Table structure for table `zq_org_config` */

DROP TABLE IF EXISTS `zq_org_config`;

CREATE TABLE `zq_org_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `org_name` varchar(100) NOT NULL COMMENT '机构名称',
  `contacts` varchar(30) NOT NULL COMMENT '联系人',
  `mobile` varchar(20) NOT NULL COMMENT '电话',
  `assign_sms_count` int(11) NOT NULL DEFAULT '0' COMMENT '分配短息数量',
  `used_count` int(11) NOT NULL DEFAULT '0' COMMENT '已使用短信条数',
  `secret_key` char(32) NOT NULL COMMENT '密钥',
  `create_time` datetime NOT NULL,
  `update_time` datetime NOT NULL,
  `authorize_eid` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_org_config` */

/*Table structure for table `zq_organizer` */

DROP TABLE IF EXISTS `zq_organizer`;

CREATE TABLE `zq_organizer` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(200) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '公司名字',
  `company_created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `enabled` tinyint(1) DEFAULT NULL COMMENT '是否启用',
  `logo` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '公司logo',
  `manager_id` int(11) unsigned NOT NULL,
  `username` char(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `password` char(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_1_idx` (`manager_id`) USING BTREE,
  CONSTRAINT `zq_organizer_ibfk_1` FOREIGN KEY (`manager_id`) REFERENCES `zq_member` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_organizer` */

insert  into `zq_organizer`(`id`,`name`,`company_created_at`,`enabled`,`logo`,`manager_id`,`username`,`password`) values (1,'西博会',NULL,1,NULL,27392,'xbh','xbh888');

/*Table structure for table `zq_pages` */

DROP TABLE IF EXISTS `zq_pages`;

CREATE TABLE `zq_pages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(11) NOT NULL DEFAULT '0' COMMENT '展会id',
  `page_name` char(50) NOT NULL DEFAULT '' COMMENT '页面名称',
  `page_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '页面类型',
  `theme_id` int(11) NOT NULL DEFAULT '11' COMMENT '主题id',
  `ticket_price` decimal(4,2) NOT NULL DEFAULT '0.00' COMMENT '票价',
  `protocol` text NOT NULL COMMENT '购票协议',
  `logo` varchar(100) NOT NULL DEFAULT '' COMMENT 'logo地址',
  `pcbg` varchar(255) DEFAULT NULL COMMENT 'PC背景图',
  `pcbg_defined` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是自定义PC背景图 0否 1是',
  `bg` varchar(100) NOT NULL DEFAULT '' COMMENT '背景图片',
  `bg_defined` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是移动端背景图 0否 1是',
  `state` tinyint(1) NOT NULL DEFAULT '1' COMMENT '页面状态1、正常 0、停用',
  `client` tinyint(1) NOT NULL DEFAULT '1' COMMENT '客户端1、PC  2、手机',
  `band_activity` char(50) NOT NULL DEFAULT '' COMMENT '绑定活动ID',
  `is_vote` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否调查问卷',
  `page_footer` text COMMENT '页脚信息',
  PRIMARY KEY (`id`),
  KEY `exhibition_id` (`exhibition_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_pages` */

insert  into `zq_pages`(`id`,`exhibition_id`,`page_name`,`page_type`,`theme_id`,`ticket_price`,`protocol`,`logo`,`pcbg`,`pcbg_defined`,`bg`,`bg_defined`,`state`,`client`,`band_activity`,`is_vote`,`page_footer`) values (1,1,'默认购票页面',1,11,'0.00','0','','/themes/buyticket/original/thumb/Bg.jpg',0,'/themes/buyticket/original/thumb/mobile/Bg.png',0,1,1,'',0,NULL),(2,2,'默认购票页面',1,11,'0.00','0','',NULL,0,'',0,1,1,'',0,NULL);

/*Table structure for table `zq_pinpai` */

DROP TABLE IF EXISTS `zq_pinpai`;

CREATE TABLE `zq_pinpai` (
  `pinpai` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `chenxing` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `msg` text COLLATE utf8_unicode_ci,
  `exhibition_id` int(11) DEFAULT '0',
  KEY `pinpai` (`pinpai`) USING BTREE,
  KEY `exhibition_id` (`exhibition_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_pinpai` */

/*Table structure for table `zq_post` */

DROP TABLE IF EXISTS `zq_post`;

CREATE TABLE `zq_post` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(128) NOT NULL,
  `content` text NOT NULL,
  `tags` text NOT NULL,
  `user_id` int(11) NOT NULL,
  `created_at` int(11) NOT NULL,
  `updated_at` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

/*Data for the table `zq_post` */

/*Table structure for table `zq_profile` */

DROP TABLE IF EXISTS `zq_profile`;

CREATE TABLE `zq_profile` (
  `member_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `name` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '姓名',
  `company` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '公司名称',
  `position` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '职位',
  `avatar_url` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '头像',
  `sex` tinyint(11) NOT NULL DEFAULT '1' COMMENT '性别:1男，0女，2保密',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `region_id` int(11) DEFAULT '0' COMMENT '地区ID',
  `tagline` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '一句话介绍',
  `region` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '地区',
  PRIMARY KEY (`member_id`)
) ENGINE=InnoDB AUTO_INCREMENT=27442 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

