/*Table structure for table `zq_set_sale_ticket` */

DROP TABLE IF EXISTS `zq_set_sale_ticket`;

CREATE TABLE `zq_set_sale_ticket` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `exhibition_id` int(11) NOT NULL COMMENT '展会id',
  `type` int(11) NOT NULL DEFAULT '1' COMMENT '限制类型：1、免费票、2、一元票',
  `limit_total_tickets` int(11) NOT NULL DEFAULT '0' COMMENT '限购总票数',
  `limit_day_tickets` int(11) NOT NULL DEFAULT '0' COMMENT '日限购总票数',
  `buy_start_time` int(11) NOT NULL COMMENT '购票开始时间 unix时间戳',
  `buy_end_time` int(11) NOT NULL COMMENT '购票结束时间 unix时间戳',
  `updated_time` int(11) NOT NULL COMMENT '记录修改时间 unix时间戳',
  `created_time` int(11) NOT NULL COMMENT '记录创建时间 unix时间戳',
  `modified_by` int(11) NOT NULL COMMENT '修改者',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT;

/*Data for the table `zq_set_sale_ticket` */

