/*Table structure for table `zq_sms_log` */

DROP TABLE IF EXISTS `zq_sms_log`;

CREATE TABLE `zq_sms_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '展会ID',
  `name` char(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '接收者姓名',
  `mobile` varchar(16) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `msg` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '短信内容',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `create_by` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_mobile` (`mobile`) USING BTREE,
  KEY `fd_idx` (`create_by`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

