/*Table structure for table `zq_socket_link_info` */

DROP TABLE IF EXISTS `zq_socket_link_info`;

CREATE TABLE `zq_socket_link_info` (
  `member_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `fd` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT 'socket链接号',
  `joiner_id` int(11) NOT NULL DEFAULT '0' COMMENT '展商id',
  `car_brand_id` int(11) NOT NULL DEFAULT '0' COMMENT '展商品牌id',
  `exhibition_id` int(11) NOT NULL DEFAULT '0' COMMENT '展会id',
  `create_time` datetime NOT NULL,
  UNIQUE KEY `exhibition_id` (`exhibition_id`,`member_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_socket_link_info` */

/*Table structure for table `zq_sys_messages` */

DROP TABLE IF EXISTS `zq_sys_messages`;

CREATE TABLE `zq_sys_messages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `from_member_id` int(11) NOT NULL DEFAULT '0' COMMENT '消息发送人',
  `to_member_id` int(11) NOT NULL DEFAULT '0' COMMENT '消息接收人',
  `title` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `msg` text COLLATE utf8_unicode_ci NOT NULL COMMENT '消息内容',
  `exhibition_id` int(11) NOT NULL DEFAULT '0' COMMENT '展会id',
  `msg_type` int(3) NOT NULL DEFAULT '0' COMMENT '消息类型 1、票证分发  2、商机匹配 3、优惠活动 4、产品发布',
  `is_read` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否阅读',
  `link_label` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `pc_url` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `m_url` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` datetime NOT NULL,
  `update_at` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `to_member_id` (`to_member_id`) USING BTREE,
  KEY `exhibition_id` (`exhibition_id`) USING BTREE,
  KEY `is_read` (`is_read`) USING BTREE,
  KEY `msg_type` (`msg_type`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

