/*Table structure for table `zq_template` */

DROP TABLE IF EXISTS `zq_template`;

CREATE TABLE `zq_template` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '模板标题',
  `industy_id` tinyint(3) NOT NULL DEFAULT '0' COMMENT '模板所属展会类型',
  `show_pic` varchar(125) CHARACTER SET utf8 NOT NULL COMMENT '模板缩微图',
  `save_path` varchar(125) CHARACTER SET utf8 NOT NULL COMMENT '模板存放路径',
  `create_time` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_industy_id` (`industy_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_template` */

/*Table structure for table `zq_template_form` */

DROP TABLE IF EXISTS `zq_template_form`;

CREATE TABLE `zq_template_form` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `org_id` int(11) NOT NULL COMMENT '主办方id',
  `label` varchar(30) CHARACTER SET utf8 NOT NULL COMMENT '标签名称',
  `form_type` tinyint(1) NOT NULL COMMENT '表单类型1、单行文本2、多行文本3、单选4、多选5、下拉菜单6、联动子菜单',
  `child_id` int(11) NOT NULL DEFAULT '0' COMMENT '联动菜单的子项目id',
  `exhibition_id` int(11) NOT NULL COMMENT '展会id',
  `prompt` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '提示语',
  PRIMARY KEY (`id`),
  KEY `idx_org_id` (`org_id`) USING BTREE,
  KEY `idx_form_type` (`form_type`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_template_form` */

/*Table structure for table `zq_template_form_linkage_value` */

DROP TABLE IF EXISTS `zq_template_form_linkage_value`;

CREATE TABLE `zq_template_form_linkage_value` (
  `id` int(11) NOT NULL,
  `item_name` varchar(100) CHARACTER SET utf8 NOT NULL COMMENT '字段名称',
  `item_value` varchar(100) CHARACTER SET utf8 NOT NULL COMMENT '字段值',
  `item_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '字段类型1、父级2、子集',
  `form_id` int(11) NOT NULL,
  `parent_id` int(11) NOT NULL COMMENT '父级id',
  PRIMARY KEY (`id`),
  KEY `idx_form_id` (`form_id`) USING BTREE,
  KEY `idx_item_type` (`item_type`) USING BTREE,
  KEY `idx_paren_id` (`parent_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_template_form_linkage_value` */

/*Table structure for table `zq_template_form_value` */

DROP TABLE IF EXISTS `zq_template_form_value`;

CREATE TABLE `zq_template_form_value` (
  `id` int(11) NOT NULL,
  `form_id` int(11) NOT NULL,
  `item_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '字段名',
  `item_value` varchar(100) CHARACTER SET utf8 NOT NULL COMMENT '字段值',
  PRIMARY KEY (`id`),
  KEY `idx_form_id` (`form_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_template_form_value` */

/*Table structure for table `zq_template_old` */

DROP TABLE IF EXISTS `zq_template_old`;

CREATE TABLE `zq_template_old` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `cat` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '抢购、免费索票',
  `title` varchar(64) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '标题',
  `banner_url` varchar(256) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '广告URL',
  `about` varchar(256) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '关于',
  `news` varchar(256) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '新闻',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_template_old` */

/*Table structure for table `zq_ticket` */

DROP TABLE IF EXISTS `zq_ticket`;

CREATE TABLE `zq_ticket` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发票人用户id',
  `to_member_id` int(11) NOT NULL DEFAULT '0',
  `exhibition_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '展会ID',
  `channel_cat` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '渠道类型',
  `channel_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '渠道ID',
  `seqnum` varchar(32) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '序列码',
  `qr_img_url` varchar(256) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '二维码url',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `use_time` datetime DEFAULT NULL COMMENT '使用票的时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态码, 0:票串码已生成, 1:票已与观众绑定, 2:票已使用, 3:票被作废',
  `receiver` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '电子票接收者',
  `mobile` char(24) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '接受者电话',
  `certificate_type_id` int(11) DEFAULT '0' COMMENT '证件类型',
  `is_disable` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否禁用   0：未禁用  1：禁用',
  `buyer_member_id` int(11) NOT NULL DEFAULT '0',
  `is_online_buy` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否在线购买',
  `is_syn` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已经与轧机同步禁用状态   0：未同步 1：已同步',
  `openid` char(32) CHARACTER SET utf8 DEFAULT NULL,
  `times` int(3) DEFAULT '0' COMMENT '入场次数',
  `is_reset` tinyint(1) unsigned DEFAULT '0' COMMENT '是否是撤回禁用标识    奇数表示启动禁用，偶数表示撤回禁用',
