/*Table structure for table `zq_ticket_attr_page_cfg` */

DROP TABLE IF EXISTS `zq_ticket_attr_page_cfg`;

CREATE TABLE `zq_ticket_attr_page_cfg` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(11) NOT NULL DEFAULT '0' COMMENT '展会id',
  `ticket_attribute` tinyint(2) NOT NULL DEFAULT '0' COMMENT '票证属性',
  `joiner_id` int(11) NOT NULL DEFAULT '0' COMMENT '参展方id',
  `qr_space_left` int(4) DEFAULT NULL COMMENT '二维码距离左边框距离',
  `qr_space_top` int(4) DEFAULT NULL COMMENT '二维码距离上边框距离',
  `ad_img_url` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '广告图片地址',
  `ticket_background_url` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '背景图片地址',
  `ticket_url` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '电子票地址',
  `use_roles` text COLLATE utf8_unicode_ci COMMENT '使用规则',
  `ticket_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '票证类型 0、赠票 1、在线电子票',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_exhibition_id` (`exhibition_id`) USING BTREE,
  KEY `idx_joiner_id` (`joiner_id`) USING BTREE,
  KEY `idx_ticket_type` (`ticket_type`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

