  KEY `idx_fid` (`fid`) USING BTREE,
  KEY `idx_pid` (`pid`) USING BTREE,
  KEY `exhibition_id` (`exhibition_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=68 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

