/*Table structure for table `zq_ticket_discount` */

DROP TABLE IF EXISTS `zq_ticket_discount`;

CREATE TABLE `zq_ticket_discount` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(11) NOT NULL DEFAULT '0' COMMENT '展会id',
  `page_id` int(11) NOT NULL DEFAULT '0' COMMENT '页面id',
  `ticket_count` int(4) NOT NULL DEFAULT '1' COMMENT '购票数量，默认1张，数量不同，折扣不同',
  `price_discount` int(4) NOT NULL DEFAULT '100' COMMENT '折扣，默认100，即无折扣，用户只能输入整数，如90%',
