/*Table structure for table `zq_ticket_ext` */

DROP TABLE IF EXISTS `zq_ticket_ext`;

CREATE TABLE `zq_ticket_ext` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `seqnum` varchar(32) NOT NULL COMMENT '二维码',
  `eid` int(11) DEFAULT '1' COMMENT '展会ID',
  `idnum` varchar(80) DEFAULT '' COMMENT '身份证',
  `age` tinyint(3) DEFAULT '0' COMMENT '年龄',
  `receiver` char(64) DEFAULT NULL COMMENT '接收票人的姓名',
  `mobile` char(24) DEFAULT NULL COMMENT '手机',
  `make_name` varchar(80) DEFAULT '' COMMENT '预购品牌',
  `type_series_name` varchar(80) DEFAULT '' COMMENT '预购车型',
  `payment` char(200) DEFAULT '' COMMENT '支付方式',
  `url` varchar(200) DEFAULT '' COMMENT '票证地址URL',
  `sms` varchar(2048) DEFAULT '' COMMENT '短信内容',
  `price` char(32) DEFAULT '' COMMENT '金额：免费、一元',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `use_time` datetime DEFAULT NULL COMMENT '进场时间',
  `call_number` int(11) DEFAULT '0' COMMENT '呼叫次数',
  `c_code` varchar(32) DEFAULT '' COMMENT '轧机扫描用的密文',
  PRIMARY KEY (`id`),
  UNIQUE KEY `seqnum` (`seqnum`,`eid`) USING BTREE,
  KEY `call_number` (`call_number`) USING BTREE,
  KEY `make_name` (`make_name`) USING BTREE,
  KEY `c_code` (`c_code`) USING BTREE,
  KEY `mobile` (`mobile`) USING BTREE,
  KEY `payment` (`payment`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

