/*Table structure for table `zq_ticket_paper` */

DROP TABLE IF EXISTS `zq_ticket_paper`;

CREATE TABLE `zq_ticket_paper` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '展会ID',
  `seqnum` varchar(32) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '序列码',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `use_time` datetime DEFAULT NULL COMMENT '使用票的时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态码, 0:票串码已生成, 1:票已与观众绑定, 2:票已使用, 3:票被作废',
  `receiver` varchar(64) CHARACTER SET utf8 DEFAULT '纸质票' COMMENT '电子票接收者',
  `mobile` char(24) COLLATE utf8_unicode_ci DEFAULT '无' COMMENT '接受者电话',
  `is_disable` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否禁用   0：未禁用  1：禁用',
  `identify_card_number` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `exhibition_id` (`exhibition_id`,`seqnum`) USING BTREE,
  KEY `idx_mobile` (`mobile`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_ticket_paper` */

/*Table structure for table `zq_ticket_sms_receive` */

DROP TABLE IF EXISTS `zq_ticket_sms_receive`;

CREATE TABLE `zq_ticket_sms_receive` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `exhibition_id` int(10) DEFAULT NULL COMMENT '展会id',
  `member_id` int(10) DEFAULT NULL COMMENT '发票人员id',
  `status` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_ticket_sms_receive` */

/*Table structure for table `zq_ticket_store_bak` */

DROP TABLE IF EXISTS `zq_ticket_store_bak`;

CREATE TABLE `zq_ticket_store_bak` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `seqnum` char(32) COLLATE utf8_unicode_ci NOT NULL,
  `exhibition_id` int(11) NOT NULL,
  `state` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:未使用 1：已使用',
  `create_time` datetime DEFAULT NULL,
  `send_time` datetime DEFAULT NULL,
  `type` tinyint(1) DEFAULT '0' COMMENT '1:赠票2：展商证3:演艺证4:媒体证5：展商服务证',
  `ph` char(36) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_seqnum` (`seqnum`) USING BTREE,
  KEY `idx_exhibition_id` (`exhibition_id`) USING BTREE,
  KEY `idx_state` (`state`) USING BTREE,
  KEY `ph` (`ph`) USING BTREE,
  KEY `type` (`type`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_ticket_store_bak` */

/*Table structure for table `zq_vote_answer` */

DROP TABLE IF EXISTS `zq_vote_answer`;

CREATE TABLE `zq_vote_answer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `vote_set_id` int(11) NOT NULL DEFAULT '0' COMMENT '投票配置',
  `answer` varchar(11) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `vote_set_id` (`vote_set_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_vote_answer` */

/*Table structure for table `zq_vote_data` */

DROP TABLE IF EXISTS `zq_vote_data`;

CREATE TABLE `zq_vote_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `vote_answer` int(11) NOT NULL,
  `vote_set_id` int(11) NOT NULL,
  `vote_uuid` char(36) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `vote_answer` (`vote_answer`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_vote_data` */

/*Table structure for table `zq_vote_set` */

DROP TABLE IF EXISTS `zq_vote_set`;

CREATE TABLE `zq_vote_set` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `page_id` int(11) NOT NULL DEFAULT '0' COMMENT '页面id',
  `exhibition_id` int(11) NOT NULL DEFAULT '0' COMMENT '展会id',
  `question` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '问题',
  `is_required` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否必填',
  `sort` int(3) NOT NULL DEFAULT '0' COMMENT '排序',
  `vote_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '单选或者多选 1、单选 2、多选',
  `create_time` datetime NOT NULL,
  `create_by` int(11) NOT NULL,
  `modify_time` datetime NOT NULL,
  `modify_by` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `page_id` (`page_id`) USING BTREE,
  KEY `sort` (`sort`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_vote_set` */

/*Table structure for table `zq_vote_user_info` */

DROP TABLE IF EXISTS `zq_vote_user_info`;

CREATE TABLE `zq_vote_user_info` (
  `int` int(11) NOT NULL AUTO_INCREMENT,
  `uname` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户名',
  `mobile` char(15) COLLATE utf8_unicode_ci NOT NULL COMMENT '电话',
  `page_id` int(11) NOT NULL,
  `vote_uuid` char(36) COLLATE utf8_unicode_ci NOT NULL,
  `vote_time` datetime NOT NULL,
  PRIMARY KEY (`int`),
  KEY `page_id` (`page_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

/*Data for the table `zq_vote_user_info` */

/*Table structure for table `zq_wechat` */

DROP TABLE IF EXISTS `zq_wechat`;

CREATE TABLE `zq_wechat` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '公众号ID',
  `name` varchar(512) NOT NULL DEFAULT '' COMMENT '公众号名称',
  `gh_id` varchar(32) NOT NULL DEFAULT '' COMMENT '原始ID',
  `appid` varchar(64) NOT NULL DEFAULT '' COMMENT '应用ID',
  `appsecret` varchar(64) NOT NULL DEFAULT '' COMMENT '应用密钥',
  `url` varchar(256) NOT NULL DEFAULT '' COMMENT '支付完跳转地址',
  `token` varchar(64) NOT NULL DEFAULT '' COMMENT '令牌',
  `encoding_key` varchar(64) NOT NULL DEFAULT '' COMMENT '消息加密密钥',
  `wx_mchid` varchar(64) NOT NULL DEFAULT '' COMMENT '微信支付商户号',
  `wx_key` varchar(64) NOT NULL DEFAULT '' COMMENT '微信支付API密钥',
  `wx_notify_url` varchar(256) NOT NULL DEFAULT '' COMMENT '微信支付异步通知回调地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

